void do_dsp_lsm0(void)
{
    uint32_t i;

    arm_lms_norm_instance_f32 lms = {0};

    // 原始波形: 200Hz 正弦波 + 50Hz 正弦波
    for (i = 0; i < SAMPLES_SIZE; ++i)
        mix[i] = (org[i] = arm_sin_f32(2 * M_PI * 50 * i / SAMPLE_RATE)) + arm_sin_f32(2 * M_PI * 200 * i / SAMPLE_RATE);

    memset(lms_coeffs, 0, sizeof(lms_coeffs));
    memset(lms_state, 0, sizeof(lms_state));

    arm_lms_norm_init_f32(&lms, COEFFS_SIZE /* 滤波器系数个数 */, lms_coeffs /* 滤波器系数 */, lms_state, 0.1 /* 步长 */, BLOCK_SIZE /* 单步处理数 */);

    // 滤除 200Hz 正弦波
    for (i = 0; i < SAMPLES_SIZE; i += BLOCK_SIZE)
        arm_lms_norm_f32(&lms, mix + i, org + i, out + i, err + i, BLOCK_SIZE);

    for (i = 0; i < SAMPLES_SIZE; ++i)
        println("%f,%f,%f,%f", org[i], mix[i], out[i], err[i]);
		
		// ref = out
}

void do_dsp_lsm1(void)
{
    uint32_t i;

    arm_lms_norm_instance_f32 lms;

    memset(lms_coeffs, 0, sizeof(lms_coeffs));
    memset(lms_state, 0, sizeof(lms_state));

    // 原始波形:  10Hz 正弦波 + 20Hz 正弦波 + 30Hz 正弦波 + 高斯分布白噪声 + 均匀分布白噪声
    arm_lms_norm_init_f32(&lms, COEFFS_SIZE, lms_coeffs, lms_state, 0.01, BLOCK_SIZE);

    // 滤除 高斯分布白噪声 和 均匀分布白噪声
    for (i = 0; i < SAMPLES_SIZE; i += BLOCK_SIZE)
        arm_lms_norm_f32(&lms, mix1 + i, org1 + i, out + i, err + i, BLOCK_SIZE);

    for (i = 0; i < SAMPLES_SIZE; ++i)
        println("%f,%f,%f,%f", org1[i], mix1[i], out[i], err[i]);
}

void do_dsp_lsm2(void)
{
    uint32_t i;

    arm_lms_norm_instance_f32 lms;

    memset(lms_coeffs, 0, sizeof(lms_coeffs));
    memset(lms_state, 0, sizeof(lms_state));

    // 原始波形:  任意波形 + 高斯分布白噪声 + 均匀分布白噪声
    arm_lms_norm_init_f32(&lms, COEFFS_SIZE, lms_coeffs, lms_state, 0.1, BLOCK_SIZE);

    // 滤除 高斯分布白噪声 和 均匀分布白噪声
    for (i = 0; i < SAMPLES_SIZE; i += BLOCK_SIZE)
        arm_lms_norm_f32(&lms, mix2 + i, org2 + i, out + i, err + i, BLOCK_SIZE);

    for (i = 0; i < SAMPLES_SIZE; ++i)
        println("%f,%f,%f,%f", org2[i], mix2[i], out[i], err[i]);
}

int main()
{
    uint8_t i;

    board_init();
	
		// 依次输出：原始信号，混合后信号，滤波后信号，偏差信号（混合-滤波）

    do_dsp_lsm0();

    for (i = 0; i < 128; ++i)
        println("0,0,0,0");

    do_dsp_lsm1();
    for (i = 0; i < 128; ++i)
        println("0,0,0,0");

    do_dsp_lsm2();

    while (1) {}

    return 0;
}
